import Layout from '../components/Layout';

const About = () => (
        <Layout>
            <div>
                <h1>Gallery</h1>
                <h4>This is the ultimate spot for our photography lovers .</h4>
                <h4>Enjoy</h4>
            </div>
        </Layout>
    );

export default About;
